import { useState } from "react";
import Square from "./Square";
import { isValidMove, KingMoved, RookMoved } from "./chessRules";

const pieceImages: { [key: string]: string } = {
  P: "/pieces/wP.png",
  p: "/pieces/bP.png",
  R: "/pieces/wR.png",
  r: "/pieces/bR.png",
  N: "/pieces/wN.png",
  n: "/pieces/bN.png",
  B: "/pieces/wB.png",
  b: "/pieces/bB.png",
  Q: "/pieces/wQ.png",
  q: "/pieces/bQ.png",
  K: "/pieces/wK.png",
  k: "/pieces/bK.png",
};

const initialBoard: string[] = [
  "rnbqkbnr",
  "pppppppp",
  "........",
  "........",
  "........",
  "........",
  "PPPPPPPP",
  "RNBQKBNR",
];

const Board: React.FC = () => {
  const [board, setBoard] = useState<string[][]>(initialBoard.map(row => row.split("")));
  const [selected, setSelected] = useState<[number, number] | null>(null);

  // Trạng thái castling
  const [kingMoved, setKingMoved] = useState<KingMoved>({ white: false, black: false });
  const [rookMoved, setRookMoved] = useState<RookMoved>({ wA: false, wH: false, bA: false, bH: false });

  const handleClick = (r: number, c: number) => {
    if (!selected) {
      if (board[r][c] !== ".") setSelected([r, c]);
      return;
    }

    const [r1, c1] = selected;
    const piece = board[r1][c1];
    if (!piece || piece === ".") {
      setSelected(null);
      return;
    }

    // Castling vua trắng và đen
    if ((piece === "K" && r1 === 7 && c1 === 4) || (piece === "k" && r1 === 0 && c1 === 4)) {
      const isWhite = piece === "K";

      // Ngắn
      if (c === 6) {
        const newBoard = board.map(row => [...row]);
        newBoard[r1][c1] = ".";
        newBoard[r1][c] = piece;
        newBoard[r1][7] = ".";
        newBoard[r1][5] = isWhite ? "R" : "r";
        setBoard(newBoard);
        if (isWhite) { setKingMoved({ ...kingMoved, white: true }); setRookMoved({ ...rookMoved, wH: true }); }
        else { setKingMoved({ ...kingMoved, black: true }); setRookMoved({ ...rookMoved, bH: true }); }
        setSelected(null);
        return;
      }
      // Dài
      if (c === 2) {
        const newBoard = board.map(row => [...row]);
        newBoard[r1][c1] = ".";
        newBoard[r1][c] = piece;
        newBoard[r1][0] = ".";
        newBoard[r1][3] = isWhite ? "R" : "r";
        setBoard(newBoard);
        if (isWhite) { setKingMoved({ ...kingMoved, white: true }); setRookMoved({ ...rookMoved, wA: true }); }
        else { setKingMoved({ ...kingMoved, black: true }); setRookMoved({ ...rookMoved, bA: true }); }
        setSelected(null);
        return;
      }
    }

    // Di chuyển bình thường
    if (isValidMove(piece, r1, c1, r, c, board, kingMoved, rookMoved)) {
      const newBoard = board.map(row => [...row]);
      newBoard[r1][c1] = ".";

      // Promotion tự động
      if (piece.toLowerCase() === "p" && (r === 0 || r === 7)) {
        newBoard[r][c] = piece === "P" ? "Q" : "q";
      } else {
        newBoard[r][c] = piece;
      }

      // Cập nhật trạng thái vua/xe nếu di chuyển
      if (piece === "K") setKingMoved({ ...kingMoved, white: true });
      if (piece === "k") setKingMoved({ ...kingMoved, black: true });
      if (piece === "R" && r1 === 7 && c1 === 0) setRookMoved({ ...rookMoved, wA: true });
      if (piece === "R" && r1 === 7 && c1 === 7) setRookMoved({ ...rookMoved, wH: true });
      if (piece === "r" && r1 === 0 && c1 === 0) setRookMoved({ ...rookMoved, bA: true });
      if (piece === "r" && r1 === 0 && c1 === 7) setRookMoved({ ...rookMoved, bH: true });

      setBoard(newBoard);
    }

    setSelected(null);
  };

  return (
    <div
      style={{
        display: "grid",
        gridTemplateColumns: "repeat(8, 60px)",
        gridTemplateRows: "repeat(8, 60px)",
        border: "2px solid black",
      }}
    >
      {board.map((row, i) =>
        row.map((piece, j) => {
          const color = (i + j) % 2 === 0 ? "#f0d9b5" : "#b58863";
          const piecePath = pieceImages[piece] || "";
          const isSelected = selected?.[0] === i && selected?.[1] === j;
          return (
            <Square
              key={`${i}-${j}`}
              value={piecePath}
              isSelected={isSelected}
              onClick={() => handleClick(i, j)}
              color={color}
            />
          );
        })
      )}
    </div>
  );
};

export default Board;
